import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import {
  HeaderWrapper,
  Logo,
  HeaderItemBar,
  Headernav,
  HeaderLogin,
  HeaderBtn,
  Stick,
  Wrapper,
  ProfileBtn,
} from "./mainStyle"
import Slider from "react-slick";
import Img1 from "../assets/banner/1.jpg"
import Img2 from "../assets/banner/2.jpg"
import Img3 from "../assets/banner/3.jpg"
import Img4 from "../assets/banner/4.jpg"

const Main = () => {

  const settings = {
    fade: true,
    infinite: true,
    speed: 700,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: false,
    autoplaySpeed: 1000,
    autoplay: true,
  };

  const imgslide = [{
    value:0,
    imgurl: Img1
  },{
    value:1,
    imgurl: Img2
  },{
    value:2,
    imgurl: Img3
  },{
    value:3,
    imgurl: Img4
  }]

  return (
    <>
        <HeaderWrapper>
          <Wrapper>          
          <StyledSlider {...settings}>
            {imgslide.map(item =>{
                return(
                    <ImageContainer>
                    <Image src={item.imgurl}></Image>
                    </ImageContainer>
                )
            })}
          </StyledSlider>
          </Wrapper>
        </HeaderWrapper>
    </>
  );
};

export default Main;


const StyledSlider = styled(Slider)`
  .slick-slide div {
    outline: none;
  }
`;

const ImageContainer = styled.div`
  margin: 0 auto;
  position: relative;
`;

const Image = styled.img`
  width: 100%;
  height: 650px;
  margin: 0 auto;
  object-fit: cover;
`;
